// components/FormDataDisplay.js
import React from 'react';

const FormDataDisplay = ({ formData }) => {
  return (
    <div>
      <h2>Dados do formulário enviados:</h2>
      <p>
        <strong>Nome:</strong> {formData.name}
      </p>
      <p>
        <strong>E-mail:</strong> {formData.email}
      </p>
      <p>
        <strong>Tipo de Solicitação:</strong> {formData.requestType}
      </p>
      {formData.requestType === 'Projeto Vendido' && (
        <p>
          <strong>Nome do Projeto:</strong> {formData.projectName}
        </p>
      )}
      {formData.requestType === 'Venda somente de hardwares' && (
        <p>
          <strong>Tipo de Hardware:</strong> {formData.hardwareType}
        </p>
      )}
      {formData.requestType === 'Prova de conceito (POC)' && (
        <p>
          <strong>Descrição da POC:</strong> {formData.pocDescription}
        </p>
      )}
    </div>
  );
};

export default FormDataDisplay;
